- input: "TEXT\x1CC00241323\x1C.TEXT\x1C\x1CF3XA\x1CRegarding item #4 on Letter dated
    Jan. 16, 2008 from FEC, Marlene Daughtrey, Sr. Campaign Analyst:  The Lincoln
    Club of Riverside County does not have a permanent office.  The Lincoln Club engages
    various facilities for their functions and meetings and as such does not pay monthly
    rent & utilities.  Therefore, there are no allocable administrative expenses for
    these items on the FEC Form 3X.                                                                                                                                                              Regarding
    item #5 on Letter dated Jan. 16, 2008 from FEC, Marlene Daughtrey, Sr. Campaign
    Analyst:  Expenditures made for Republican Party Reception on Schedule H4 were
    not for federal candidates nor for fundraising activity.  These items were in
    fact incorrectly billed to and paid by the Lincoln Club.  (Should have been billed
    to Republican Party.)  These items were refunded by the Mission Inn (see line
    15) and subsequently allocated back to the non-federal account per the original
    allocation (see line 22)."
